(768,	767,	22,	'',	'You have a new applicant for your Class <a href=\"/class/103\">Snales</a>. Please go to the <a href=\"/class/103\">class page</a> and approve/reject the applicant within the next 24 hours, i.e. until March 16, 2015 7:04 PM CET.',	'2015-03-15 18:04:27',	'',	0),
(769,	768,	23,	'',	'You have recently applied to the class <a href=\"/class/103\">Snales</a>.\n<a href=\"/profile/zwei\">Markus Zwei</a> has accepted your request and would be happy to welcoming you to his event.\nAll that is left is the payment. Please click the link below in order to pay the full amount of 251 CHF. <a href=\"/classes/payment/pay/id/103/format/smoothbox\" class=\"smoothbox\">Pay Now</a>\nYou have time until March 19, 2015 7:06 PM CET',	'2015-03-15 18:06:50',	'',	0),
(770,	769,	21,	'',	'You have recently applied to the class <a href=\"/class/103\">Snales</a>.\nUnfortunately <a href=\"/profile/zwei\">Markus Zwei</a> was not able to react to your application within 24 hours, you are most welcome to try and apply again to this class or choose any other class you desire to join.',	'2015-03-17 13:24:42',	'',	0),
(771,	770,	23,	'',	'You have recently applied to the class <a href=\"/class/107\">Sushi</a>.\nUnfortunately <a href=\"/profile/admin\">First Last</a> was not able to react to your application within 24 hours, you are most welcome to try and apply again to this class or choose any other class you desire to join.',	'2015-03-17 13:24:42',	'',	0),
(772,	771,	23,	'',	'Dear Reto Spescha, you were accepted for the class <a href=\"/class/103\">Snales</a>. We would like to kindly remind you to pay the class fee of 234.00 CHF by 03.19.2015. <a href=\"/classes/payment/pay/id/103/format/smoothbox\" class=\"smoothbox\">Pay Now</a> You have time until March 20, 2015 12:27 AM EET',	'2015-03-18 22:27:28',	'',	0),
(773,	772,	23,	'',	'Dear Reto Spescha, you were accepted for the class <a href=\"/class/103\">Snales</a>.\nUnfortunately we have not received the payment of the class fee so far. If you still would like to join the class, you will have to apply again. You are most welcome to apply for any other class you desire to join.',	'2015-03-19 21:01:57',	'',	0),
(774,	773,	22,	'',	'You have recently accepted <a href=\"/profile/reto\">Reto Spescha</a> to the class <a href=\"/class/103\">Snales</a>.\nUnfortunately <a href=\"/profile/reto\">Reto Spescha</a> has not paid within the given timeframe of three days. He was notified that he has not paid and that he has to apply for the class again if he still wants to join.',	'2015-03-19 21:01:57',	'',	0),
